package Practice;

import java.util.Scanner;

public class _1537 {
	
	static void f(int n) {
		if(n == 1) System.out.print("hello");
		else System.out.print("world");
		
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Scanner stdIn = new Scanner(System.in);
		
		int n = stdIn.nextInt();
		f(n);

	}

}
